import './App.css';
import React from 'react';
import { ExportCSV } from './react-flow-renderer/ExportCSV ';
import ReactFlowRenderer from "./react-flow-renderer"

const App = () => {
  const fileName = 'Scada'
  const viewers = [
    { id: 1, name: 'sakumar' },
    { id: 2, name: 'kumar' }

  ]
  return (
    <div>
      <h1>Редактор мнемосхем для SCADA-системы</h1>
      <div>

        <ExportCSV csvData={viewers} fileName={fileName} />

      </div>
      <ReactFlowRenderer />
    </div>
  )
}

export default App;
